import { useEffect,useState } from "react";

const Home=()=>{
    const [workout,setworkout]=useState(null)
    useEffect(()=>{
        const fetchworkout= async ()=>{
            const workouts=await fetch("/api/workout")
            const res=(await workouts).json()
            console.log(res)
            if (workouts.ok){
                setworkout(res)

            }

        }
        fetchworkout()
    },[]);
    return (
        <div className="home">
            <p> {workout[0].title}</p>
        </div>
    )
}
export default Home;
